// <iframe src="Matthew_Liu-Resume.pdf" style="height: 76vw; width: 60%" frameborder="0"></iframe>
import "../css/masterStyle.css";
import nolanpdf from "../assets/NolanNguyenResume_0224.pdf";

export default function Resume() {
  return (
    <div className="container">
      <h1>Resume</h1>
      <iframe
        className="elementcenter"
        title="nolanpdf"
        src={nolanpdf}
        frameborder="0"
        width="70%"
        height="1000"
        // style={{ height: "76vw", width: "60%" }}
      ></iframe>
    </div>
  );
}
